  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset shows whether each dataset
  on data.maryland.gov has been updated recently enough. For example, datasets containing
  weekly data should be updated at least every 7 days. Datasets containing monthly
  data should be updated at least every 31 days. This dataset also shows a compendium
  of metadata from all data.maryland.gov datasets.rnrnThis report was created by the
  Department of Information Technology (DoIT) on August 12 2015. New reports will
  be uploaded daily (this report is itself included in the report, so that users can
  see whether new reports are consistently being uploaded each week). Generation of
  this report uses the Socrata Open Data (API) to retrieve metadata on date of last
  data update and update frequency. Analysis and formatting of the metadata use Javascript,
  jQuery, and AJAX.rnrnThis report will be used during meetings of the Maryland Open
  Data Council to curate datasets for maintenance and make sure the Open Data Portal's
  data stays up to date.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
